import React from "react";
import styled from "styled-components";

export const StyledDiv = styled.div`
  margin: 5%;
  width: 50vw;
`;

export const StyledBtn = styled.button`
  color: #fff;
  background-color: #1b95e0;
  border-radius: 5px;
`;
